using System;
using System.Diagnostics;
using System.Drawing;
using System.IO;
using System.Runtime.InteropServices;
using System.Windows.Forms;

namespace HytaleBorderless
{
    public class MainForm : Form
    {
        private Process selectedProcess;
        private Button btnBorderless, btnRestore, btnRefresh;
        private ListBox lstProcesses;
        private Label lblStatus;
        private Panel panelMain;
        private PictureBox picLogo;

        private const string LOGO_BASE64 =
            "";

        [DllImport("user32.dll")] private static extern int SetWindowLong(IntPtr hWnd, int nIndex, int dwNewLong);
        [DllImport("user32.dll")] private static extern int GetWindowLong(IntPtr hWnd, int nIndex);
        [DllImport("user32.dll")] private static extern bool SetWindowPos(IntPtr hWnd, IntPtr hWndInsertAfter, int X, int Y, int cx, int cy, uint uFlags);
        [DllImport("user32.dll")] private static extern bool ShowWindow(IntPtr hWnd, int nCmdShow);

        private const int GWL_STYLE = -16;
        private const int WS_BORDER = 0x00800000;
        private const int WS_CAPTION = 0x00C00000;
        private const int WS_THICKFRAME = 0x00040000;
        private const uint SWP_FRAMECHANGED = 0x0020;
        private const uint SWP_SHOWWINDOW = 0x0040;
        private const int SW_RESTORE = 9;

        public MainForm()
        {
            InitializeComponent();
            RefreshProcesses();
        }

        private void InitializeComponent()
        {
            Text = "Hytale Borderless v1.2";
            Size = new Size(520, 420);
            StartPosition = FormStartPosition.CenterScreen;
            FormBorderStyle = FormBorderStyle.FixedSingle;
            BackColor = Color.FromArgb(30, 35, 50);
            ForeColor = Color.White;
            MaximizeBox = false;

            panelMain = new Panel
            {
                Dock = DockStyle.Fill,
                BackColor = Color.FromArgb(45, 50, 70),
                Padding = new Padding(20)
            };
            Controls.Add(panelMain);

            picLogo = new PictureBox
            {
                Size = new Size(220, 110),
                Location = new Point((Width - 260) / 2, 20),
                SizeMode = PictureBoxSizeMode.Zoom,
                Image = LoadEmbeddedLogo()
            };
            panelMain.Controls.Add(picLogo);

            lblStatus = new Label
            {
                Text = "Click Refresh to scan for HytaleClient.exe",
                Location = new Point(20, 140),
                Size = new Size(460, 24),
                TextAlign = ContentAlignment.MiddleCenter,
                Font = new Font("Segoe UI", 10),
                ForeColor = Color.LightGray
            };
            panelMain.Controls.Add(lblStatus);

            lstProcesses = new ListBox
            {
                Location = new Point(20, 175),
                Size = new Size(460, 110),
                BackColor = Color.FromArgb(60, 65, 85),
                ForeColor = Color.White,
                BorderStyle = BorderStyle.FixedSingle,
                Font = new Font("Segoe UI", 10),
                DrawMode = DrawMode.OwnerDrawFixed,
                ItemHeight = 28
            };
            lstProcesses.DrawItem += DrawProcessItem;
            lstProcesses.DoubleClick += (s, e) => MakeBorderless();
            panelMain.Controls.Add(lstProcesses);

            btnRefresh = CreateButton("Refresh", new Point(20, 305));
            btnBorderless = CreateButton("Borderless", new Point(190, 305));
            btnRestore = CreateButton("Restore", new Point(360, 305));

            btnRefresh.Click += (s, e) => RefreshProcesses();
            btnBorderless.Click += (s, e) => MakeBorderless();
            btnRestore.Click += (s, e) => RestoreWindow();

            panelMain.Controls.Add(btnRefresh);
            panelMain.Controls.Add(btnBorderless);
            panelMain.Controls.Add(btnRestore);
        }

        private Image LoadEmbeddedLogo()
        {
            try
            {
                byte[] data = Convert.FromBase64String(LOGO_BASE64);
                using (var ms = new MemoryStream(data))
                    return Image.FromStream(ms);
            }
            catch
            {
                return null;
            }
        }

        private Button CreateButton(string text, Point location)
        {
            return new Button
            {
                Text = text,
                Location = location,
                Size = new Size(130, 45),
                FlatStyle = FlatStyle.Flat,
                BackColor = Color.FromArgb(60, 65, 85),
                ForeColor = Color.White,
                Font = new Font("Segoe UI", 10, FontStyle.Bold)
            };
        }

        private void DrawProcessItem(object sender, DrawItemEventArgs e)
        {
            if (e.Index < 0) return;
            e.DrawBackground();
            e.Graphics.DrawString("HytaleClient detected", e.Font, Brushes.White,
                e.Bounds.Left + 10, e.Bounds.Top + 6);
        }

        private void RefreshProcesses()
        {
            lstProcesses.Items.Clear();

            foreach (var p in Process.GetProcessesByName("HytaleClient"))
                if (!string.IsNullOrEmpty(p.MainWindowTitle))
                    lstProcesses.Items.Add(p);

            lblStatus.Text = lstProcesses.Items.Count > 0
                ? "HytaleClient found"
                : "No HytaleClient.exe running";
        }

        private Process GetProcess()
        {
            foreach (var p in Process.GetProcessesByName("HytaleClient"))
                if (!string.IsNullOrEmpty(p.MainWindowTitle))
                    return p;

            return null;
        }

        private void MakeBorderless()
        {
            var p = GetProcess();
            if (p == null) return;

            selectedProcess = p;

            int style = GetWindowLong(p.MainWindowHandle, GWL_STYLE);
            style &= ~(WS_CAPTION | WS_THICKFRAME | WS_BORDER);
            SetWindowLong(p.MainWindowHandle, GWL_STYLE, style);

            Rectangle screen = Screen.PrimaryScreen.Bounds;
            SetWindowPos(p.MainWindowHandle, IntPtr.Zero,
                screen.Left, screen.Top, screen.Width, screen.Height,
                SWP_FRAMECHANGED | SWP_SHOWWINDOW);

            lblStatus.Text = "Borderless applied";
        }

        private void RestoreWindow()
        {
            if (selectedProcess == null) return;
            ShowWindow(selectedProcess.MainWindowHandle, SW_RESTORE);
            lblStatus.Text = "Window restored";
        }

        [STAThread]
        static void Main()
        {
            Application.EnableVisualStyles();
            Application.Run(new MainForm());
        }
    }
}
